6. What is destructuring?

Destructuring allows extracting values from arrays or objects. It makes code shorter and cleaner. It improves readability. It is widely used in modern JavaScript.

***

27. What is the spread operator?

The spread operator (...) expands arrays or objects. It is used to copy or merge data. It helps avoid mutation. It simplifies code.

***

28. What is a ternary operator?

It is a shorthand for if-else. It has three parts: condition, true result, false result. It makes code concise. It improves readability when used properly.

***

29. What is strict mode?

Strict mode enforces better coding practices. It prevents the use of undeclared variables. It catches silent errors. It improves code security.

***

30. What is a single-page application (SPA)?

An SPA loads a single HTML page and updates content dynamically. It provides a fast user experience. It avoids full page reloads. React and Angular use this model.

